function AddProduct(props){

    const {addItem} = props

    function handler(event){
        if (event.key === prompt('')){
            addItem(event.target.value)
        }
    }
    return(
        <div className="but_area"
        
        >
            <button onClick={() => handler}>Добавить новый товар</button>
        </div>
    )
}

export default AddProduct
